import React from 'react';
import { Card, CardContent, Typography, Button, Grid } from '@mui/material';

function HiringList({ contrataciones, handleEstadoChange, classes }) {
  return (
    <Grid container spacing={3}>
      {contrataciones.map((contratacion) => (
        <Grid item xs={12} sm={6} md={4} key={contratacion.id}>
          <Card className={classes.card}>
            <CardContent>
              <Typography variant="h6">{contratacion.servicio}</Typography>
              <Typography color="textSecondary">
                contratacion.usuario
              </Typography>
              <Typography color="textSecondary">
                contratacion.numeroTelefonico
              </Typography>
              <Typography color="textSecondary">
                contratacion.horarioContacto
              </Typography>
              <Typography color="textSecondary">contratacion.estado</Typography>
            </CardContent>
            {/* Aquí puedes agregar botones o acciones adicionales si lo deseas */}
            {/* Por ejemplo, un botón para cambiar el estado de la contratación */}
            <Button
              onClick={() => handleEstadoChange(contratacion.id, 'nuevoEstado')}
            >
              Cambiar Estado
            </Button>
          </Card>
        </Grid>
      ))}
    </Grid>
  );
}

export default HiringList;
